import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { RootState } from '../store/store';

interface Listing {
  id: string;
  title: string;
  description: string;
  propertyType: string;
  rentAmount: number;
  rentType: string;
  bedrooms: number;
  bathrooms: number;
  area: number;
  areaUnit: string;
  address: {
    street: string;
    city: string;
    state: string;
    zipCode: string;
    country: string;
  };
  amenities: string[];
  availableFrom: string;
  images: string[];
  contactPhone: string;
  contactEmail: string;
  isNegotiable: boolean;
  petFriendly: boolean;
  furnished: boolean;
  parking: boolean;
  securityDeposit: number;
  advanceRent: number;
  ownerId: string;
  status: 'active' | 'inactive' | 'rented';
  createdAt: string;
  updatedAt: string;
}

const ListingsPage: React.FC = () => {
  const { user } = useSelector((state: RootState) => state.auth);
  const [listings, setListings] = useState<Listing[]>([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    search: '',
    propertyType: '',
    minPrice: '',
    maxPrice: '',
    bedrooms: '',
    bathrooms: '',
    furnished: '',
    petFriendly: '',
    parking: '',
  });
  const [sortBy, setSortBy] = useState('createdAt');
  const [viewMode, setViewMode] = useState<'grid' | 'list'>('grid');

  useEffect(() => {
    fetchListings();
  }, [filters, sortBy]);

  const fetchListings = async () => {
    setLoading(true);
    try {
      // TODO: Replace with actual API call
      // const response = await listingsAPI.getListings(filters);
      // setListings(response.listings);
      
      // Mock data for now
      const mockListings: Listing[] = [
        {
          id: '1',
          title: 'Modern 2BR Apartment in Thamel',
          description: 'Beautiful modern apartment in the heart of Thamel with all amenities.',
          propertyType: 'apartment',
          rentAmount: 45000,
          rentType: 'monthly',
          bedrooms: 2,
          bathrooms: 2,
          area: 1200,
          areaUnit: 'sqft',
          address: {
            street: 'Thamel Marg',
            city: 'Kathmandu',
            state: 'Bagmati',
            zipCode: '44600',
            country: 'Nepal'
          },
          amenities: ['WiFi', 'AC', 'Kitchen', 'Balcony'],
          availableFrom: '2024-01-01',
          images: ['https://images.unsplash.com/photo-1560448204-e02f11c3d0e2?w=500'],
          contactPhone: '+977-1-4444444',
          contactEmail: 'owner@example.com',
          isNegotiable: true,
          petFriendly: true,
          furnished: true,
          parking: true,
          securityDeposit: 90000,
          advanceRent: 45000,
          ownerId: 'owner1',
          status: 'active',
          createdAt: '2024-01-01T00:00:00Z',
          updatedAt: '2024-01-01T00:00:00Z'
        },
        {
          id: '2',
          title: 'Spacious 3BR House in Baneshwor',
          description: 'Large family house with garden and parking space.',
          propertyType: 'house',
          rentAmount: 75000,
          rentType: 'monthly',
          bedrooms: 3,
          bathrooms: 3,
          area: 2000,
          areaUnit: 'sqft',
          address: {
            street: 'Baneshwor Chowk',
            city: 'Kathmandu',
            state: 'Bagmati',
            zipCode: '44600',
            country: 'Nepal'
          },
          amenities: ['Garden', 'Parking', 'Kitchen', 'Study Room'],
          availableFrom: '2024-01-15',
          images: ['https://images.unsplash.com/photo-1570129477492-45c003edd2be?w=500'],
          contactPhone: '+977-1-5555555',
          contactEmail: 'owner2@example.com',
          isNegotiable: false,
          petFriendly: false,
          furnished: false,
          parking: true,
          securityDeposit: 150000,
          advanceRent: 75000,
          ownerId: 'owner2',
          status: 'active',
          createdAt: '2024-01-02T00:00:00Z',
          updatedAt: '2024-01-02T00:00:00Z'
        },
        {
          id: '3',
          title: 'Cozy 1BR Studio in Patan',
          description: 'Perfect studio apartment for students or young professionals.',
          propertyType: 'room',
          rentAmount: 25000,
          rentType: 'monthly',
          bedrooms: 1,
          bathrooms: 1,
          area: 600,
          areaUnit: 'sqft',
          address: {
            street: 'Patan Durbar Square',
            city: 'Lalitpur',
            state: 'Bagmati',
            zipCode: '44700',
            country: 'Nepal'
          },
          amenities: ['WiFi', 'Kitchen', 'Study Desk'],
          availableFrom: '2024-01-10',
          images: ['https://images.unsplash.com/photo-1522708323590-d24dbb6b0267?w=500'],
          contactPhone: '+977-1-6666666',
          contactEmail: 'owner3@example.com',
          isNegotiable: true,
          petFriendly: false,
          furnished: true,
          parking: false,
          securityDeposit: 50000,
          advanceRent: 25000,
          ownerId: 'owner3',
          status: 'active',
          createdAt: '2024-01-03T00:00:00Z',
          updatedAt: '2024-01-03T00:00:00Z'
        }
      ];
      
      setListings(mockListings);
    } catch (error) {
      console.error('Error fetching listings:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleFilterChange = (key: string, value: string) => {
    setFilters(prev => ({
      ...prev,
      [key]: value
    }));
  };

  const clearFilters = () => {
    setFilters({
      search: '',
      propertyType: '',
      minPrice: '',
      maxPrice: '',
      bedrooms: '',
      bathrooms: '',
      furnished: '',
      petFriendly: '',
      parking: '',
    });
  };

  const filteredListings = listings.filter(listing => {
    if (filters.search && !listing.title.toLowerCase().includes(filters.search.toLowerCase())) {
      return false;
    }
    if (filters.propertyType && listing.propertyType !== filters.propertyType) {
      return false;
    }
    if (filters.minPrice && listing.rentAmount < parseInt(filters.minPrice)) {
      return false;
    }
    if (filters.maxPrice && listing.rentAmount > parseInt(filters.maxPrice)) {
      return false;
    }
    if (filters.bedrooms && listing.bedrooms < parseInt(filters.bedrooms)) {
      return false;
    }
    if (filters.bathrooms && listing.bathrooms < parseInt(filters.bathrooms)) {
      return false;
    }
    if (filters.furnished && listing.furnished !== (filters.furnished === 'true')) {
      return false;
    }
    if (filters.petFriendly && listing.petFriendly !== (filters.petFriendly === 'true')) {
      return false;
    }
    if (filters.parking && listing.parking !== (filters.parking === 'true')) {
      return false;
    }
    return true;
  });

  const sortedListings = [...filteredListings].sort((a, b) => {
    switch (sortBy) {
      case 'price-low':
        return a.rentAmount - b.rentAmount;
      case 'price-high':
        return b.rentAmount - a.rentAmount;
      case 'date':
        return new Date(b.createdAt).getTime() - new Date(a.createdAt).getTime();
      default:
        return 0;
    }
  });

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Header */}
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900 mb-2">
            Find Your Perfect Home
          </h1>
          <p className="text-gray-600">
            Discover amazing properties in Kathmandu Valley
          </p>
        </div>

        {/* Search and Filters */}
        <div className="bg-white shadow rounded-lg mb-8">
          <div className="p-6">
            {/* Search Bar */}
            <div className="mb-6">
              <div className="relative">
                <input
                  type="text"
                  placeholder="Search properties by title, location, or description..."
                  value={filters.search}
                  onChange={(e) => handleFilterChange('search', e.target.value)}
                  className="w-full pl-10 pr-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />
                <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                  <svg className="h-5 w-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
                  </svg>
                </div>
              </div>
            </div>

            {/* Filters Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4 mb-6">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Property Type
                </label>
                <select
                  value={filters.propertyType}
                  onChange={(e) => handleFilterChange('propertyType', e.target.value)}
                  className="w-full border border-gray-300 rounded-md px-3 py-2 focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                >
                  <option value="">All Types</option>
                  <option value="apartment">Apartment</option>
                  <option value="house">House</option>
                  <option value="room">Room</option>
                  <option value="commercial">Commercial</option>
                </select>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Min Price (NPR)
                </label>
                <input
                  type="number"
                  placeholder="Min"
                  value={filters.minPrice}
                  onChange={(e) => handleFilterChange('minPrice', e.target.value)}
                  className="w-full border border-gray-300 rounded-md px-3 py-2 focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Max Price (NPR)
                </label>
                <input
                  type="number"
                  placeholder="Max"
                  value={filters.maxPrice}
                  onChange={(e) => handleFilterChange('maxPrice', e.target.value)}
                  className="w-full border border-gray-300 rounded-md px-3 py-2 focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Bedrooms
                </label>
                <select
                  value={filters.bedrooms}
                  onChange={(e) => handleFilterChange('bedrooms', e.target.value)}
                  className="w-full border border-gray-300 rounded-md px-3 py-2 focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                >
                  <option value="">Any</option>
                  <option value="1">1+</option>
                  <option value="2">2+</option>
                  <option value="3">3+</option>
                  <option value="4">4+</option>
                </select>
              </div>
            </div>

            {/* Additional Filters */}
            <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-6">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Bathrooms
                </label>
                <select
                  value={filters.bathrooms}
                  onChange={(e) => handleFilterChange('bathrooms', e.target.value)}
                  className="w-full border border-gray-300 rounded-md px-3 py-2 focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                >
                  <option value="">Any</option>
                  <option value="1">1+</option>
                  <option value="2">2+</option>
                  <option value="3">3+</option>
                </select>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Furnished
                </label>
                <select
                  value={filters.furnished}
                  onChange={(e) => handleFilterChange('furnished', e.target.value)}
                  className="w-full border border-gray-300 rounded-md px-3 py-2 focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                >
                  <option value="">Any</option>
                  <option value="true">Furnished</option>
                  <option value="false">Unfurnished</option>
                </select>
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  Pet Friendly
                </label>
                <select
                  value={filters.petFriendly}
                  onChange={(e) => handleFilterChange('petFriendly', e.target.value)}
                  className="w-full border border-gray-300 rounded-md px-3 py-2 focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                >
                  <option value="">Any</option>
                  <option value="true">Yes</option>
                  <option value="false">No</option>
                </select>
              </div>
            </div>

            {/* Filter Actions */}
            <div className="flex justify-between items-center">
              <button
                onClick={clearFilters}
                className="text-blue-600 hover:text-blue-800 font-medium"
              >
                Clear All Filters
              </button>
              <div className="flex items-center space-x-4">
                <span className="text-sm text-gray-600">
                  {filteredListings.length} properties found
                </span>
              </div>
            </div>
          </div>
        </div>

        {/* Sort and View Controls */}
        <div className="flex justify-between items-center mb-6">
          <div className="flex items-center space-x-4">
            <label className="text-sm font-medium text-gray-700">Sort by:</label>
            <select
              value={sortBy}
              onChange={(e) => setSortBy(e.target.value)}
              className="border border-gray-300 rounded-md px-3 py-2 text-sm focus:ring-2 focus:ring-blue-500 focus:border-transparent"
            >
              <option value="date">Newest First</option>
              <option value="price-low">Price: Low to High</option>
              <option value="price-high">Price: High to Low</option>
            </select>
          </div>

          <div className="flex items-center space-x-2">
            <button
              onClick={() => setViewMode('grid')}
              className={`p-2 rounded-md ${
                viewMode === 'grid'
                  ? 'bg-blue-100 text-blue-600'
                  : 'bg-gray-100 text-gray-600 hover:bg-gray-200'
              }`}
            >
              <svg className="w-5 h-5" fill="currentColor" viewBox="0 0 20 20">
                <path d="M5 3a2 2 0 00-2 2v2a2 2 0 002 2h2a2 2 0 002-2V5a2 2 0 00-2-2H5zM5 11a2 2 0 00-2 2v2a2 2 0 002 2h2a2 2 0 002-2v-2a2 2 0 00-2-2H5zM11 5a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2h-2a2 2 0 01-2-2V5zM11 13a2 2 0 012-2h2a2 2 0 012 2v2a2 2 0 01-2 2h-2a2 2 0 01-2-2v-2z" />
              </svg>
            </button>
            <button
              onClick={() => setViewMode('list')}
              className={`p-2 rounded-md ${
                viewMode === 'list'
                  ? 'bg-blue-100 text-blue-600'
                  : 'bg-gray-100 text-gray-600 hover:bg-gray-200'
              }`}
            >
              <svg className="w-5 h-5" fill="currentColor" viewBox="0 0 20 20">
                <path fillRule="evenodd" d="M3 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1zm0 4a1 1 0 011-1h12a1 1 0 110 2H4a1 1 0 01-1-1z" clipRule="evenodd" />
              </svg>
            </button>
          </div>
        </div>

        {/* Listings Grid/List */}
        {loading ? (
          <div className="flex justify-center items-center py-12">
            <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
          </div>
        ) : sortedListings.length === 0 ? (
          <div className="text-center py-12">
            <svg className="mx-auto h-12 w-12 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4" />
            </svg>
            <h3 className="mt-2 text-sm font-medium text-gray-900">No properties found</h3>
            <p className="mt-1 text-sm text-gray-500">
              Try adjusting your search criteria or filters.
            </p>
          </div>
        ) : (
          <div className={viewMode === 'grid' ? 'grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6' : 'space-y-6'}>
            {sortedListings.map((listing) => (
              <div
                key={listing.id}
                className={`bg-white rounded-lg shadow-md overflow-hidden hover:shadow-lg transition-shadow ${
                  viewMode === 'list' ? 'flex' : ''
                }`}
              >
                {/* Property Image */}
                <div className={viewMode === 'list' ? 'w-1/3' : 'w-full'}>
                  <img
                    src={listing.images[0] || 'https://images.unsplash.com/photo-1560448204-e02f11c3d0e2?w=500'}
                    alt={listing.title}
                    className={`object-cover ${viewMode === 'list' ? 'h-full' : 'h-48 w-full'}`}
                  />
                </div>

                {/* Property Details */}
                <div className={`p-6 ${viewMode === 'list' ? 'w-2/3' : ''}`}>
                  <div className="flex justify-between items-start mb-2">
                    <h3 className="text-lg font-semibold text-gray-900 line-clamp-2">
                      {listing.title}
                    </h3>
                    <span className="text-lg font-bold text-blue-600">
                      NPR {listing.rentAmount.toLocaleString()}
                    </span>
                  </div>

                  <p className="text-gray-600 text-sm mb-4 line-clamp-2">
                    {listing.description}
                  </p>

                  <div className="flex items-center text-sm text-gray-500 mb-4">
                    <svg className="w-4 h-4 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
                    </svg>
                    {listing.address.city}, {listing.address.state}
                  </div>

                  <div className="flex items-center space-x-4 text-sm text-gray-600 mb-4">
                    <span className="flex items-center">
                      <svg className="w-4 h-4 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 7v10a2 2 0 002 2h14a2 2 0 002-2V9a2 2 0 00-2-2H5a2 2 0 00-2-2z" />
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 5a2 2 0 012-2h4a2 2 0 012 2v6H8V5z" />
                      </svg>
                      {listing.bedrooms} BR
                    </span>
                    <span className="flex items-center">
                      <svg className="w-4 h-4 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M8 14v3m4-3v3m4-3v3M3 21h18M3 10h18M3 7l9-4 9 4M4 10h16v11H4V10z" />
                      </svg>
                      {listing.bathrooms} BA
                    </span>
                    <span className="flex items-center">
                      <svg className="w-4 h-4 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 8V4m0 0h4M4 4l5 5m11-1V4m0 0h-4m4 0l-5 5M4 16v4m0 0h4m-4 0l5-5m11 5l-5-5m5 5v-4m0 4h-4" />
                      </svg>
                      {listing.area} {listing.areaUnit}
                    </span>
                  </div>

                  <div className="flex flex-wrap gap-2 mb-4">
                    {listing.furnished && (
                      <span className="px-2 py-1 bg-green-100 text-green-800 text-xs rounded-full">
                        Furnished
                      </span>
                    )}
                    {listing.petFriendly && (
                      <span className="px-2 py-1 bg-blue-100 text-blue-800 text-xs rounded-full">
                        Pet Friendly
                      </span>
                    )}
                    {listing.parking && (
                      <span className="px-2 py-1 bg-purple-100 text-purple-800 text-xs rounded-full">
                        Parking
                      </span>
                    )}
                    {listing.isNegotiable && (
                      <span className="px-2 py-1 bg-yellow-100 text-yellow-800 text-xs rounded-full">
                        Negotiable
                      </span>
                    )}
                  </div>

                  <div className="flex justify-between items-center">
                    <Link
                      to={`/listings/${listing.id}`}
                      className="bg-blue-600 text-white px-4 py-2 rounded-md hover:bg-blue-700 transition-colors text-sm font-medium"
                    >
                      View Details
                    </Link>
                    {user && (
                      <button className="text-blue-600 hover:text-blue-800 text-sm font-medium">
                        Schedule Visit
                      </button>
                    )}
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default ListingsPage;
